import React from 'react'
import{usestate} from 'react'

export default function Main12() {
    const[name,setName] = usestate();
    const{Id,setId} =usestate();
    const[Email,setEmail] = usestate();
    const[score,setScore] = usestate();
  return (
    <div>
        <input name='text' placeholder='Enter your name' onChange={(e) =>setName(e.target.value)}></input>
        <input name='text' placeholder='Enter your Id' onChange={(e) =>setId(e.target.value)}></input>
        <input name='text' placeholder='Enter your Email' onChange={(e) =>setEmail(e.target.value)}></input>
        <input type='text' placeholder='Enter your Score' onChange={(e) =>setScore(e.target.value)}></input>

    </div>
  )
}
